{"PhysicalProperty"=>{"Property"=>[{"PropertyID"=>{"Identification"=>{"PrimaryID"=>"22", "MarketingName"=>"Lakeside Apartments", "WebSite"=>"http://www.lakesidecentreville.com/", "BozzutoURL"=>"http://bozzuto.com/apartments/communities/22-lakeside-apartments", "Latitude"=>"38.8321", "Longitude"=>"-77.4412"}, "Address"=>{"Address1"=>"6221 Summer Pond Drive", "City"=>"Centreville", "State"=>"VA", "PostalCode"=>"20121", "CountyName"=>"Fairfax", "Lead2LeaseEmail"=>"lakesideboz@lead2lease.com"}, "Phone"=>{"Type"=>"office", "PhoneNumber"=>"888.471.6132"}}, "Information"=>{"OfficeHour"=>[{"OpenTime"=>"12:00 PM", "CloseTime"=>"5:00 PM", "Day"=>"Sunday"}, {"OpenTime"=>"9:00 AM", "CloseTime"=>"6:00 PM", "Day"=>"Monday"}, {"OpenTime"=>"9:00 AM", "CloseTime"=>"6:00 PM", "Day"=>"Tuesday"}, {"OpenTime"=>"9:00 AM", "CloseTime"=>"6:00 PM", "Day"=>"Wednesday"}, {"OpenTime"=>"9:00 AM", "CloseTime"=>"6:00 PM", "Day"=>"Thursday"}, {"OpenTime"=>"9:00 AM", "CloseTime"=>"5:00 PM", "Day"=>"Friday"}, {"OpenTime"=>"10:00 AM", "CloseTime"=>"5:00 PM", "Day"=>"Saturday"}], "OverviewText"=>"<p>\n\tNestled around three beautiful lakes in Centre Ridge, Lakeside Apartments offers one- and two-bedroom luxury apartment homes. No matter which floor plan you choose, you'll find every amenity, every comfort and every chance to enjoy bright airy spaces expertly designed for maximum convenience.</p><p>\n\tLakeside is built on 45 landscaped acres of rolling meadows and lakes. Whether you desire to ride bikes around the lakes, work out, swim in one of the three pools, enjoy the sun on one of our decks or relax in your spacious apartment, you'll love Lakeside Apartments. We also offer a variety of time-saving services and thoughtful extras. We have a clubhouse available for private parties and meetings, a car wash, regular community events and much more.</p>", "OverviewTextStripped"=>"Nestled around three beautiful lakes in Centre Ridge, Lakeside Apartments offers one- and two-bedroom luxury apartment homes. No matter which floor plan you choose, you'll find every amenity, every comfort and every chance to enjoy bright airy spaces expertly designed for maximum convenience. Lakeside is built on 45 landscaped acres of rolling meadows and lakes. Whether you desire to ride bikes around the lakes, work out, swim in one of the three pools, enjoy the sun on one of our decks or relax in your spacious apartment, you'll love Lakeside Apartments. We also offer a variety of time-saving services and thoughtful extras. We have a clubhouse available for private parties and meetings, a car wash, regular community events and much more.", "OverviewBullet1"=>"Relax on 45 acres of beautifully landscaped grounds with three scenic lakes scattered throughout", "OverviewBullet2"=>"Resident garden and ENERGI outdoor fitness stations", "OverviewBullet3"=>"Stainless steel appliances and maple cabinetry", "NeighborhoodText"=>"<p style=\"margin-bottom: 0in;\">\n\t<span style=\"font-size: 22px;\">Paint the Town</span></p><p style=\"margin-bottom: 0in;\">\n\tEnjoy living in close proximity to restaurants, parks and art galleries at the Lakeside Apartments.</p><ul>\n\t<li>\n\n\t\t\t<strong>Restaurants:</strong> Sweetwater Tavern, Bonefish Grill, Alto Plaza, Copper Canyon, Preet Palace, Ciao Osteria, Outback Steakhouse, Carrabba's Italian Grill, Charlie Chiang's, Ledo Pizza, Bangkok City Restaurant, Chipotle\n\t</li>\n\t<li>\n\n\t\t\t<strong>Bars:</strong> Red Rock Cafï¿½ &Tequila Bar, Chasin' Tails, The Revolution Darts and Billiards, and Velocity Five Sports Restaurants & Bar</li>\n\t<li>\n\n\t\t\t<strong>Spas:</strong> Valon Salon & Day Spa, Sully Nail Salon, Prestige Nail Salon, Elizabeth Arden Red Door\n\t</li>\n\t<li>\n\n\t\t\t<strong>Hotels:</strong> Extended Stay America, Spring Hill Marriott Suites\n\t</li>\n\t<li>\n\n\t\t\t<strong>Theaters:</strong> Centreville Multiplex Cinemas, Alliance Theatre\n\t</li>\n\t<li>\n\n\t\t\t<strong>Art Galleries:</strong> Jung Fine Art Studio\n\t</li>\n\t<li>\n\n\t\t\t<strong>Parks:</strong> Bull Run Regional Park, Cub Run Park, Arrowhead Park, Chalet Woods Park\n\t</li>\n\t<li>\n\n\t\t\t<strong>Trails:</strong> Hemlock Overlook Regional Park\n\t</li>\n</ul><p style=\"margin-bottom: 0in;\">\n\t<span style=\"font-size: 22px;\">Getting Around</span></p><ul>\n\t<li>\n\n\t\t\t<strong>Metro:</strong> 13 miles south of Vienna Metro Station\n\t</li>\n\t<li>\n\n\t\t\t<strong>Bus:</strong> Fairfax Connector, located at entrance to community, takes you directly to Vienna Metro stop\n\t</li>\n\t<li>\n\n\t\t\t<strong>Airport:</strong> Dulles Airport\n\t</li>\n\t<li>\n\n\t\t\t<strong>Train Station: </strong>Amtrak station\n\t</li>\n\t<li>\n\n\t\t\t<strong>Major Highways/Roads:</strong> Located at intersection of Rts. 28 and 29, and 1 mile from I-66\n\t</li>\n</ul><p style=\"margin-bottom: 0in;\">\n\t<span style=\"font-size: 22px;\">Educate Yourself</span></p><ul>\n\t<li>\n\n\t\t\t<strong>Elementary School:</strong> Centre Ridge Elementary\n\t</li>\n\t<li>\n\n\t\t\t<strong>Middle School:</strong> Liberty Middle School\n\t</li>\n\t<li>\n\n\t\t\t<strong>High School:</strong> Centreville High School\n\t</li>\n\t<li>\n\n\t\t\t<strong>Colleges/Universities:</strong> George Mason University, Northern Virginia Community College\n\t</li>\n</ul>", "DirectionsURL"=>"http://maps.google.com/maps?daddr=6221%20Summer%20Pond%20Drive,%20Centreville,%20VA", "ListingImageURL"=>"http://bozzuto.com/system/apartment_communities/22/square.jpg", "VideoURL"=>nil, "FacebookURL"=>"http://www.facebook.com/LakesideVA", "TwitterHandle"=>"lakesideva", "PinterestURL"=>nil}, "Feature"=>[{"Title"=>"Lakeside Apartments", "Description"=>"<p>Welcome to Lakeside Apartments <br></p><p> <br>Miles from the stress. Away from the bustle. Close to perfection. <br> <br>Situated on 45 acres of beautifully landscaped grounds and bordered by peaceful lakes, life at Lakeside is an exceptional experience in the heart of Centreville. At Lakeside Apartments you’ll find the ideal home that is both spacious and contemporary, with features such as updated kitchens with stainless steel kitchen appliances, maple cabinetry, and beautiful flooring throughout. From a dip in a resort-inspired pool and a game of tennis, to socializing in a luxury clubhouse or reading a book by the lake; you’ll find life on the relaxing side of things. Located in the heart of Centreville in Fairfax County, there’s an array of shopping, dining, schools, and attractions nearby your home at Lakeside. You’ll be within easy access to Route 29 and I-66, just minutes from Dulles, and a short drive from downtown Washington D.C. <br> <br>Escape to your new sanctuary at Lakeside Apartments. </p>"}, {"Title"=>"Features", "Description"=>"<ul>\t<li>\t\tUpgraded kitchen with stainless steel appliances and maple cabinetry</li>\t<li>\t\tUpgraded baths with maple cabinetry</li>\t<li>\t\tFireplaces available</li>\t<li>\t\tIndividual full-size washer/dryer in each residence</li>\t<li>\t\tFrost-free freezer with ice maker</li>\t<li>\t\tVaulted ceilings available</li>\t<li>\t\tPatios and balconies</li>\t<li>\t\tIndividual outside storage</li>\t<li>\t\tOversized closets</li>\t<li>\t\tKemLam wood finished flooring available</li>\t<li>\t\tAvailable high-speed Internet/digital cable</li>\t<li>\t\tVerizon FiOS available</li>\n</ul><h2>\tAmenities</h2><ul>\t<li>\t\tLuxury clubhouses</li>\t<li>\t\tStarbucks wireless cafï¿½</li>\t<li>\t\tPet-friendly community</li>\t<li>\t\tDog park</li>\t<li>\t\tScenic lake views</li>\t<li>\t\tThree pools</li>\t<li>\t\tTennis court, sports court and sand volleyball court</li>\t<li>\t\tPlayground area</li>\t<li>\t\tPicnic and grilling area</li>\t<li>\t\t24-hour fitness center</li>\t<li>\t\tCar-wash area</li>\t<li>\t\tAvailable carports</li>\t<li>\t\tGuest suite available for resident guests</li>\t<li>\t\tResident garden</li>\t<li>\t\tENERGI outdoor fitness stations</li>\t<li>\t\tComplimentary weekly fitness classes</li>\t<li>\t\tComplimentary doorstep trash service</li>\n</ul>"}, {"Title"=>"Services", "Description"=>"<p>From your first step across the threshold, you'll enjoy customer service that's second to none. Whether you need your plants watered, your pet cared for or an important package delivered to your door, consider it done. Bozzuto Management is committed to doing whatever it takes to meet your needs and exceed your expectations.</p>    <p>At Lakeside, our award-winning services include:</p>    <ul><li>24-hour emergency maintenance</li><li>Starbucks wireless cafï¿½</li><li>Package-acceptance service</li><li>Maid-service referral</li><li>\"Away from Home\" service</li></ul>          <p>For a luxurious home in Centreville, Virginia that’s surrounded by natural splendor, consider living at Lakeside Apartments. This pet-friendly community includes a long list of top amenities. Guests here enjoy three pools, a Starbucks wireless cafï¿½, scenic views and a luxury clubhouse too. It’s also right by the Vienna Metro Station and Fairfax Connector stops, making it an ideal home for commuters. Don’t wait. Reach out to Bozzuto to start the leasing process on a dream apartment today.</p>"}], "FeaturedButton"=>[{"Name"=>"Pet Friendly"}, {"Name"=>"Fitness Center"}, {"Name"=>"Washer and Dryer"}], "PhotoSet"=>nil, "Slideshow"=>{"SlideshowImageURL"=>["http://bozzuto.com/system/property_slides/819/slide.jpg", "http://bozzuto.com/system/property_slides/820/slide.jpg", "http://bozzuto.com/system/property_slides/823/slide.jpg", "http://bozzuto.com/system/property_slides/824/slide.jpg", "http://bozzuto.com/system/property_slides/825/slide.jpg"]}, "Floorplan"=>[{"Id"=>"9079", "Name"=>"1 Bedroom/1 Bath - 723 square feet", "FloorplanAvailabilityURL"=>"http://lakesidecentreville.securecafe.com/onlineleasing/lakeside-apartments/oleapplication.aspx?stepname=Apartments&myOlePropertyId=90996&floorPlans=802636", "DisplayedUnitsAvailable"=>"4", "ImageURL"=>"https://cdn.rentcafe.com/dmslivecafe/3/90996/90996-2-1-51864.jpg", "Bedrooms"=>"1", "Bathrooms"