9:00 AM", "CloseTime"=>"6:00 PM", "Day"=>"Monday"}, {"OpenTime"=>"9:00 AM", "CloseTime"=>"6:00 PM", "Day"=>"Tuesday"}, {"OpenTime"=>"9:00 AM", "CloseTime"=>"6:00 PM", "Day"=>"Wednesday"}, {"OpenTime"=>"9:00 AM", "CloseTime"=>"6:00 PM", "Day"=>"Thursday"}, {"OpenTime"=>"8:00 AM", "CloseTime"=>"5:00 PM", "Day"=>"Friday"}, {"OpenTime"=>"10:00 AM", "CloseTime"=>"5:00 PM", "Day"=>"Saturday"}], "OverviewText"=>"<p>\n\tMetroPointe is more than an apartment community. It's a place where everyone blends in beautifully because everyone is unique. Where all are also united by a desire for urban convenience, contemporary design and modern living in one of the most vibrant communities in the D.C. metro area. Located right above the Wheaton Metro, but miles from the ordinary. Welcome to where you truly belong.</p>", "OverviewTextStripped"=>"MetroPointe is more than an apartment community. It's a place where everyone blends in beautifully because everyone is unique. Where all are also united by a desire for urban convenience, contemporary design and modern living in one of the most vibrant communities in the D.C. metro area. Located right above the Wheaton Metro, but miles from the ordinary. Welcome to where you truly belong.", "OverviewBullet1"=>"Award-winning apartment community ", "OverviewBullet2"=>"An exceptional level of customer service", "OverviewBullet3"=>"Directly above the Wheaton Metro (Red Line)", "NeighborhoodText"=>"<p style=\"margin-bottom: 0in;\">\n\t<span style=\"font-size: 22px;\">Paint the Town</span></p><p style=\"margin-bottom: 0in;\">\n\tWheaton is a dynamic neighborhood bustling with eclectic attractions. It's a community where your personal style and outlook are celebrated, as an increasing number of area residents are discovering every day. Conveniences are everywhere, from the Wheaton Metro (Red Line) downstairs to the many shopping malls, restaurants, markets and entertainment venues that are within minutes. MetroPointe is all about you. All the time. All the way.</p><ul>\n\t<li>\n\n\t\t\t<strong>Restaurants:</strong> Acapulco Mar-Y-Tierra, Baja Fresh, Christina's Italian Ristorante, Hollywood East Cafï¿½, IHOP, Ledo's Pizza, Legends American Grill & Billiards Tavern, Los Churros, Moby Dick's Seafood & Sushi, Nick's Diner, Pollo Campero, Quiznos, Ruby Tuesday, PJ's Rice Bistro, Dunkin Donuts, Ferdinand's Restaurant, Saigonese Restaurant, Sergio's Place, Pollo Campero\n\t</li>\n\t<li>\n\n\t\t\t<strong>Bars/Nightlife:</strong> Headliners Comedy Club, Legends, Hollywood Ballroom (Silver Spring)\n\t</li>\n\t<li>\n\n\t\t\t<strong>Stores:</strong> Giant, Safeway (coming soon), Aeropostale, Aldo, American Eagle, Bath & Body Works, Best Buy, The Children's Place, Forever 21, G by Guess, Hollister Co., JC Penney, Macy's, New York & Co., Nine West, Office Depot, Old Navy, Radio Shack, Target, Victoria's Secret, Safeway\n\t</li>\n\t<li>\n\n\t\t\t<strong>S</strong><strong>alons/Spas:</strong> American Beauty Academy, Eterna Day Spa, Hair Cuttery, JC Penney Salon & Day Spa, MasterCuts, Wheaton Nails & Hair\n\t</li>\n\t<li>\n\n\t\t\t<strong>Gyms: </strong>Bally Total Fitness, Fitness Twins Exercise Studio, Jazzercise Fitness Center\n\t</li>\n\t<li>\n\n\t\t\t<strong>Hotels:</strong> Best Western Ambassador Inn, Hilton, Days Inn, Bethesda North Marriott Hotel & Conference Center, Comfort Inn, Sheraton\n\t</li>\n\t<li>\n\n\t\t\t<strong>Banks:</strong> Bank of America, BB&T Bank, Chevy Chase, Wachovia Bank\n\t</li>\n\t<li>\n\n\t\t\t<strong>Theaters:</strong> Montgomery Royal Theaters, Regal Majestic, AMC Loews White Flint\n\t</li>\n\t<li>\n\n\t\t\t<strong>Museums:</strong> National Capital Trolley Museum, Sandy Spring Museum, George Meany Memorial Archives\n\t</li>\n\t<li>\n\n\t\t\t<strong>Sport Venues:</strong> Northwest Park Golf Course, Wheaton Ice Rink\n\t</li>\n\t<li>\n\n\t\t\t<strong>Parks:</strong> Brookside Gardens, Wheaton Regional Park, Wheaton Veterans Park, Newport Mill Park, Maryland-Nation Capital Park\n\t</li>\n\t<li>\n\n\t\t\t<strong>Trails:</strong> Little Amherst, Marathon at the Mall, Triangle Challenge, Valley View Summit, Veirs Mill Stretch-It-Out\n\t</li>\n</ul><p style=\"margin-bottom: 0in;\">\n\t<span style=\"font-size: 22px;\">Getting Around</span></p><ul>\n\t<li>\n\n\t\t\t<strong>Metro:</strong> Directly above Wheaton Metro Station (Red Line)\n\t</li>\n\t<li>\n\n\t\t\t<strong>Bus:</strong> Montgomery County Metrobus stops onsite, Greyhound station in Silver Spring\n\t</li>\n\t<li>\n\n\t\t\t<strong>Airports:</strong> Reagan National, Dulles International\n\t</li>\n\t<li>\n\n\t\t\t<strong>Train Station:</strong> Silver Spring MARC Station (5 mi.), Amtrak in Rockville (3 mi.)\n\t</li>\n\t<li>\n\n\t\t\t<strong>Major Highways/Roads:</strong> I-495\n\t</li>\n</ul><p style=\"margin-bottom: 0in;\">\n\t<span style=\"font-size: 22px;\">Educate Yourself</span></p><ul>\n\t<li>\n\n\t\t\t<strong>Elementary Schools:</strong> Arcola Elementary School, Glenallan Elementary School, Kemp Mill Elementary School\n\t</li>\n\t<li>\n\n\t\t\t<strong>Middle Schools:</strong> Sligo Middle School, Colonel E. Brooke Lee Middle School\n\t</li>\n\t<li>\n\n\t\t\t<strong>High Schools:</strong> Wheaton High School, Northwood High School, Albert Einstein High School, Blair High School\n\t</li>\n\t<li>\n\n\t\t\t<strong>Colleges/Universities:</strong> University of Maryland, George Washington University, George Mason University, Howard University, Catholic University\n\t</li>\n</ul>", "DirectionsURL"=>"http://maps.google.com/maps?daddr=11175%20Georgia%20Avenue,%20Wheaton,%20MD", "ListingImageURL"=>"http://bozzuto.com/system/apartment_communities/57/square.jpg", "VideoURL"=>"https://www.youtube.com/watch?v=HSb3qf_bFjc", "FacebookURL"=>"http://www.facebook.com/metropointeapts", "TwitterHandle"=>"MetroPointeApt", "PinterestURL"=>nil}, "Feature"=>[{"Title"=>"MetroPointe", "Description"=>"<p>\n\t<span style=\"color:#808080;\"><span style=\"font-size:12px;\">MetroPointe apartments for rent include modern amenities, urban convenience and contemporary design in beautiful Wheaton, Maryland. Renters are bound to love the property’s stellar location that’s literally right above the Wheaton Metro, making it ideal for commuters. Each spacious home includes GE black appliances, ceramic kitchen tile and wood cabinetry for a luxury feel. This pet-friendly property also features a clubroom, fitness center, business center and landscaped courtyard terraces. There's plenty more to love at the MetroPointe apartments in Maryland. </span></span></p>"}, {"Title"=>"Features", "Description"=>"<ul>\n\t<li>\n\t\tLoft and single-story flats</li>\n\t<li>\n\t\tSpacious floor plans with 9' ceilings</li>\n\t<li>\n\t\tShaker-style wood cabinetry</li>\n\t<li>\n\t\tContemporary satin nickel hardware throughout</li>\n\t<li>\n\t\tMoen faucets throughout</li>\n\t<li>\n\t\tGE black appliances</li>\n\t<li>\n\t\tDaltile ceramic kitchen tile</li>\n\t<li>\n\t\tConvenient package shelf outside resident entry</li>\n</ul><h2>\n\tAmenities</h2><ul>\n\t<li>\n\t\tDirect access to Wheaton Metro</li>\n\t<li>\n\t\tClub room with pool table, plasma TV and catering kitchen</li>\n\t<li>\n\t\tLarge fitness center</li>\n\t<li>\n\t\tBusiness center with conference area</li>\n\t<li>\n\t\tLandscaped courtyard terraces</li>\n\t<li>\n\t\tGarage parking with elevator access to residences</li>\n\t<li>\n\t\tWalking park</li>\n\t<li>\n\t\tZipcar </li>\n</ul><p>\n\t<span style=\"color:#808080;\"><span style=\"font-size:12px;\"><span style=\"font-family: arial, sans, sans-serif; white-space: pre-wrap;\">Looking for top amenities in a contemporary and luxurious apartment community? Then look no further than MetroPointe in Wheaton, Maryland. The pet-friendly property is right by the Wheaton Metro, making traveling to D.C., Virginia and Maryland a breeze. Top amenities here include a clubroom, fitness center and landscaped courtyard terraces. Contact Bozzuto today to discuss leasing at this incredible community. </span></span></span>