tments with panoramic views of Washington, D.C. and the Potomac River. Enjoy the convenience of living steps from the Crystal City Metro and the walkable neighborhood of Pentagon City shops and restaurants. Your options are endless including the Fashion Center of Pentagon City, Pentagon Row, Costco, Jaleo, Legal Seafood, Morton's The Steakhouse and so much more. </p><p>\n\tThe apartments are newly remodeled featuring beautiful kitchens including birch cabinetry, granite-inspired countertops, wood plank flooring and premium appliances.</p><p>\n\t including a stunning rooftop deck with incredible views of DC, plus a club room with bar and cozy fireplace. Also enjoy our 24-hour fitness center with yoga studio and our indoor basketball and racquetball court. </p>", "OverviewTextStripped"=>"The Paramount, conveniently located in Arlington, VA features spacious and newly renovated apartments with panoramic views of Washington, D.C. and the Potomac River. Enjoy the convenience of living steps from the Crystal City Metro and the walkable neighborhood of Pentagon City shops and restaurants. Your options are endless including the Fashion Center of Pentagon City, Pentagon Row, Costco, Jaleo, Legal Seafood, Morton's The Steakhouse and so much more. The apartments are newly remodeled featuring beautiful kitchens including birch cabinetry, granite-inspired countertops, wood plank flooring and premium appliances.  including a stunning rooftop deck with incredible views of DC, plus a club room with bar and cozy fireplace. Also enjoy our 24-hour fitness center with yoga studio and our indoor basketball and racquetball court.", "OverviewBullet1"=>"Stunning amenities with rooftop terrace with panoramic view of DC and the Potomac River.", "OverviewBullet2"=>"Large, newly remodeled kitchens featuring birch cabinetry, granite-inspired countertops, plank flooring and premium appliances.", "OverviewBullet3"=>"Enjoy the walkable neighborhood to shopping, dining and nightlife. Plus have easy