nroe Street NE", "City"=>"Washington", "State"=>"DC", "PostalCode"=>"20017", "CountyName"=>nil, "Lead2LeaseEmail"=>"MonroeStMarket.Boz@lead2lease.com"}, "Phone"=>{"Type"=>"office", "PhoneNumber"=>"877.237.6961"}}, "Information"=>{"OfficeHour"=>[{"OpenTime"=>"12:00 PM", "CloseTime"=>"5:00 PM", "Day"=>"Sunday"}, {"OpenTime"=>"9:00 AM", "CloseTime"=>"6:00 PM", "Day"=>"Monday"}, {"OpenTime"=>"9:00 AM", "CloseTime"=>"6:00 PM", "Day"=>"Tuesday"}, {"OpenTime"=>"9:00 AM", "CloseTime"=>"6:00 PM", "Day"=>"Wednesday"}, {"OpenTime"=>"9:00 AM", "CloseTime"=>"6:00 PM", "Day"=>"Thursday"}, {"OpenTime"=>"9:00 AM", "CloseTime"=>"5:00 PM", "Day"=>"Friday"}, {"OpenTime"=>"10:00 AM", "CloseTime"=>"5:00 PM", "Day"=>"Saturday"}], "OverviewText"=>"<p>\n\t<span style=\"font-size:12px;\">The newly opened Monroe Street Market brings three distinct styles of living to the eclectic Brookland neighborhood in Washington, DC. Discover a unique mix of apartments, the arts and vibrant shops and restaurants at the Brookland-CUA Metro Station. Which style is right for you?</span></p><p>\n\t<span style=\"font-size:12px;\"><strong>Monroe Street Market and Cathedral Commons Win Big at This Year’s NAHB Best in American Living Awards</strong></span></p><p>\n\t<span style=\"font-size:12px;\">This year, two Bozzuto communities, Monroe Street Market and Cathedral Commons, won a grand total of three awards at the NAHB Best in American Living Awards (BALA), the nation’s premier award program that recognizes design excellence for the entire residential building industry including single family and multifamily homes communities. The first recognition goes to Monroe Street Market, which was selected as the coveted Multifamily Community of the Year. Additionally, Bozzuto achieved the two top wins in the Urban Mixed Community category for the Platinum and Gold awards for Monroe Street Market and Cathedral Commons respectively.  Congratulations to these amazing developments and all those who worked tirelessly to make them into the award winning communities they are today. </span></p>", "OverviewTextStripped"=>"The newly opened Monroe Street Market brings three distinct styles of living to the eclectic Brookland neighborhood in Washington, DC. Discover a unique mix of apartments, the arts and vibrant shops and restaurants at the Brookland-CUA Metro Station. Which style is right for you? Monroe Street Market and Cathedral Commons Win Big at This Year’s NAHB Best in American Living Awards This year, two Bozzuto communities, Monroe Street Market and Cathedral Commons, won a grand total of three awards at the NAHB Best in American Living Awards (BALA), the nation’s premier award program that recognizes design excellence for the entire residential building industry including single family and multifamily homes communities. The first recognition goes to Monroe Street Market, which was selected as the coveted Multifamily Community of the Year. Additionally, Bozzuto achieved the two top wins in the Urban Mixed Community category for the Platinum and Gold awards for Monroe Street Market and Cathedral Commons respectively. Congratulations to these amazing developments and all those who worked tirelessly to make them into the award winning communities they are today.", "OverviewBullet1"=>"Brand new apartments with three unique styles", "OverviewBullet2"=>"Adjacent to the Brookland-CUA Red Line Metro", "OverviewBullet3"=>"Artist studios and work spaces for events, performances and more", "NeighborhoodText"=>"<p style=\"margin-bottom: 0in;\">\n\t<span style=\"font-size: 22px;\">Live Within Reach</span></p><p style=\"margin-bottom: 0in;\">\n\t<span style=\"font-size:12px;\">At Monroe Street Market, you're always in the mix. Enjoy easy access to public transportation, including the Brookland-CUA Metro Station, several bus stops, the Metropolitan Bike Trail and plenty of bars and restaurants.</span></p><h2 style=\"margin-bottom: 0in;\">\n\tJust Downstairs</h2><ul>\n\t<li>\n\n\t\t\tPotbelly, &pizza, Barnes & Noble, Busboys and Poets, Filter Coffeehouse, The Back Rack, Brookland Pint, Chipotle, Wardman Wines,<span style=\"color: rgb(40, 40, 40); font-family: 'Trebuchet MS', Arial, Helvetica, sans-serif; line-height: 18px;\"> </span>and Halsa.\n\t</li>\n</ul><h2 style=\"margin-bottom: 0in;\">\n\tAround Town</h2><ul>\n\t<li>\n\n\t\t\t<strong>Restaurants:</strong> Menomale,Little Ricky's, Brookland's Finest, Steel Plate, San Antonio Bar and Grill, Brookland Cafï¿½, MGM Roast Beef, Sala Thai, Sweet Mango, The Looking Glass, RedRocks,  Murry & Paul's, Cafe Sureia\n\t</li>\n\t<li>\n\n\t\t\t<strong>Bars</strong>: Smith Public Trust, Steel Plate, Brookland's Finest, The Looking Glass, Lace on the Avenue, Domku Bar & Cafï¿½, 9:30 Club, Tonic, Marvin, The Gibson, Wonderland Ballroom\n\t</li>\n\t<li>\n\n\t\t\t<strong>Stores</strong>: Target, CVS, Home Depot, Yes! Organic Market, Giant\n\t</li>\n\t<li>\n\n\t\t\t<strong>Hotels</strong>: Comfort Inn & Suites\n\t</li>\n\t<li>\n\n\t\t\t<strong>Theaters</strong>: Dance Place, Howard Theatre, GALA Hispanic Theater\n\t</li>\n\t<li>\n\n\t\t\t<strong>Museums</strong>: Franciscan Monastery, President Lincoln's Cottage, Pope John Paul II Cultural Center\n\t</li>\n\t<li>\n\n\t\t\t<strong>Parks</strong>: Fort Bunker Hill Park\n\t</li>\n</ul><p style=\"margin-bottom: 0in;\">\n\t<span style=\"font-size: 22px;\">Getting Around</span></p><ul>\n\t<li>\n\n\t\t\t<span style=\"font-size:12px;\"><strong>Metro: </strong>At Brookland-CUA Metro Station</span>\n\t</li>\n\t<li>\n\n\t\t\t<span style=\"font-size:12px;\"><strong>Bus: </strong>Directly across the street from Metrobus station</span>\n\t</li>\n\t<li>\n\n\t\t\t<span style=\"font-size:12px;\"><strong>Airports: </strong>About eight miles from Reagan National</span>\n\t</li>\n\t<li>\n\n\t\t\t<span style=\"font-size:12px;\"><strong>Train Station: </strong>About three miles from Union Station</span>\n\t</li>\n</ul><p style=\"margin-bottom: 0in;\">\n\t<span style=\"font-size: 22px;\">Educate Yourself</span></p><ul>\n\t<li>\n\n\t\t\t<span style=\"font-size:12px;\"><strong>Elementary School: </strong>Brookland Elementary School</span>\n\t</li>\n\t<li>\n\n\t\t\t<span style=\"font-size:12px;\"><strong>Middle School: </strong>St. Anthony Catholic School</span>\n\t</li>\n\t<li>\n\n\t\t\t<span style=\"font-size:12px;\"><strong>High School: </strong>Luke Charles Moore Academy</span>\n\t</li>\n\t<li>\n\n\t\t\t<span style=\"font-size:12px;\"><strong>Colleges/Universities:</strong> Howard University, Trinity Washington University, Catholic University of America</span>\n\t</li>\n</ul>", "DirectionsURL"=>"http://maps.google.com/maps?daddr=625%20Monroe%20Street%20NE,%20Washington,%20DC", "ListingImageURL"=>"http://bozzuto.com/system/apartment_communities/261/square.jpeg", "VideoURL"=>"https://youtu.be/PcukVkQePM0", "FacebookURL"=>"http://www.facebook.com/monroestreetmarket", "TwitterHandle"=>"MonroeStMarket", "PinterestURL"=>nil}, "Feature"=>[{"Title"=>"Monroe Street Market", "Description"=>"<p>\n\t<span style=\"color:#808080;\"><span style=\"font-size:12px;\"><span style=\"font-family: arial, sans, sans-serif;\">Residents of Monroe Street Market in Washington, D.C.’s lively Brookland neighborhood enjoy luxurious homes and a stellar location. The community is near top spots like Trinity Washington University, Basilica of the National Shrine of the Immaculate Conception, and Metropolitan Branch Bike Trail. It’s also right by the Brookland-CUA Red Line Metro, making it ideal for commuters who need to travel to Virginia, Maryland and D.C. This pet-friendly and green property also features top amenities. Guests here enjoy an outdoor swimming pool, on-site retail and dining, outdoor lounges with bars and grills, 24-hour fitness centers, e-cafï¿½ and flexible spaces for private and community events. There's plenty to love about Monroe Street Market - see a complete list of features and amenities below.</span></span></span></p>"}, {"Title"=>"Features", "Description"=>"<ul>\n\t<li>\n\t\t<span style=\"font-size:12px;\">99 floor plans to suit your personal style</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Stainless steel ENERGY STARï¿½ appliances</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Granite countertops in Wave Sand, Giallo Vermont or Rose White</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Hardwood 42\" cabinets available in shaker style or flat panel with brushed nickel hardware</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Water-saving Moen fixtures</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Parterre designer wood-style flooring in Lancaster Patina or Natural Hickory</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Sun-filled spaces with oversized windows and inspiring views</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Industrial designer pendant lighting</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Vast closet options; linen closets and pantries available</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Full-size GE ENERGY STARï¿½ washers and dryers</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Custom bathrooms with granite countertops, modern stacked tile in bath, soft gray linen texture tile floors and cabinets with drawer storage</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Pet-friendly community </span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Controlled keyless fob access</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Wired for Verizon FiOS and Comcast</span></li>\n</ul><p>\n\t<span style=\"font-size: 16px;\"><strong>Green Is In</strong></span></p><ul>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Fully digital, Web-programmable Pepco Energy Wise thermostat</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Water-saving Moen fixtures</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">GE ENERGY STARï¿½ appliances </span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Low-energy lighting throughout</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Bike storage</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Energy-tight building construction that incorporates local materials</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Recycling and green cleaning program</span></li>\n</ul><p>\n\t<span style=\"font-size: 16px;\"><strong>Optional Features</strong></span></p><ul>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Stained-concrete floors</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Expanded outdoor living spaces with terraces, balconies and patios</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Moveable kitchen islands with expanded prep space and extra storage</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Expanded ceiling heights</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Tech-friendly, custom built-in desks</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Direct-entry homes with private entrances</span></li>\n</ul><h2>\n\tAmenities</h2><p>\n\t<span style=\"font-size:16px;\"><strong>Interior Stylings</strong></span></p><ul>\n\t<li>\n\t\t<span style=\"font-size:12px;\">16,000 sq. ft. of amenity space</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">24-hour fitness centers with yoga studios, cardio theaters, weights, as well as an express gym</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Artistic workspaces throughout the community</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Lounge, community room and billiards</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">E-cafï¿½ with Wi-Fi</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Flexible spaces for community events and private parties</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Resident storage available</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Controlled keyless fob access</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Pet-friendly community</span></li>\n</ul><p>\n\t<span style=\"font-size:16px;\"><strong>Outdoor Installations</strong></span></p><ul>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Adjacent to the Brookland-CUA Metro Station and several bus stops</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Sparkling outdoor swimming pool with expansive sundeck</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Lush, beautifully landscaped courtyards</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Outdoor lounges with bars and grills</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">First-floor retail and restaurants</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Along the Metropolitan Branch Bike Trail</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Green walls and cool roofs reduce urban heat</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Garage parking available</span></li>\n</ul>"}, {"Title"=>"The Arts", "Description"=>"<p>\n\t<span style=\"font-size:16px;\"><strong>The Arts Walk</strong></span></p><p>\n\t<span style=\"font-size:12px;\">A pedestrian-friendly promenade that celebrates the arts. With art studios on both sides, you may be able to catch glimpses of works in progress — and find the perfect masterpiece at the weekend market.</span></p><ul>\n\t<li>\n\t\t<span style=\"font-size:12px;\">At the center of Brookland Works</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Lined with artist work studios</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Weekend farmers and arts markets</span></li>\n</ul><p>\n\t<strong style=\"font-size: 16px;\">Artist Work Studios</strong></p><p>\n\t<span style=\"font-size:12px;\">Whether you want to draw, paint, print, sculpt, weave or build, you'll finally have the space to express your creativity and exhibit your work in one of the spacious, new work studios at Brookland Works.</span></p><ul>\n\t<li>\n\t\t<span style=\"font-size:12px;\">27 artist work studios on the first floor of Brookland Works</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Rear patios open right up to the bike trail</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Glass garage doors let in lots of natural light</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Spacious layouts with high ceilings and bathrooms</span></li>\n</ul><p>\n\t<span style=\"font-size:16px;\"><strong>The Edgewood Arts Building</strong></span></p><p>\n\t<span style=\"font-size:12px;\">A uniquely designed, 3,000 sq. ft. dream workspace for artists of all kinds, perfect for big projects and even bigger exhibitions. Meet and mingle, get inspired or create your own masterpiece. Creativity reigns at \"The Edge.\"</span></p><ul>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Designed with floor-to-ceiling windows to let in natural light</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Pre-wired for flexible lighting and multimedia exhibits</span></li>\n\t<li>\n\t\t<span style=\"font-size:12px;\">Flexible arts and community building for hosted events and art shows</span></li>\n</ul><p>\n\t<span style=\"font-size:12px;\"><span style=\"color: rgb(128, 128, 128);\"><span style=\"font-family: arial,sans,sans-serif;\">Looking for a plush apartment community that’s in Washington, D.C. hip Brookland neighborhood? Then look no further than Monroe Street Market. This luxurious apartment home is right by the Metro and mere steps away from top restaurants, shops and retail. This green and pet-friendly building also features impressive amenities like on-site retail and dining, outdoor lounges, 24-hour fitness centers and a swimming pool. Don’t wait. Your dream apartment is just a phone call away. Get in touch with Bozzuto today to discuss leasing at this top-notch community. </span></span></span></p>"}], "FeaturedButton"=>[{"Name"=>"SmartRent"}, {"Name"=>"Pet Friendly"}, {"Name"=>"Green"}, {"Name"=>"Rapid Transit"}, {"Name"=>"Fitness Center"}, {"Name"=>"Washer and Dryer"}, {"Nam