-0/oleapplication.aspx?stepname=Apartments&myOlePropertyId=462826&floorPlans=2013561", "DisplayedUnitsAvailable"=>"1", "ImageURL"=>"https://cdn.rentcafe.com/dmslivecafe/3/462826/Portland%2520Flats%2520B8_2.jpg", "Bedrooms"=>"2", "Bathrooms"=>"2.0", "SquareFeet"=>{"Min"=>"1174", "Max"=>"1174"}, "MarketRent"=>{"Min"=>"2851", "Max"=>"5346"}, "EffectiveRent"=>{"Min"=>"2851", "Max"=>"5346"}}], "Promotion"=>nil}, {"PropertyID"=>{"Identification"=>{"PrimaryID"=>"291", "MarketingName"=>"Flats170 at Academy Yard", "WebSite"=>"http://flats170.com/", "BozzutoURL"=>"http://bozzuto.com/apartments/communities/291-flats170-at-academy-yard", "Latitude"=>"39.0872", "Longitude"=>"-76.697304"}, "Address"=>{"Address1"=>"8313 Telegraph Rd", "City"=>"Odenton", "State"=>"MD", "PostalCode"=>"21113", "CountyName"=>"Howard", "Lead2LeaseEmail"=>"Flats170atAcademyYard.Boz@lead2lease.com"}, "Phone"=>{"Type"=>"office", "PhoneNumber"=>"888.732.8160"}}, "Information"=>{"OfficeHour"=>[{"OpenTime"=>"12:00 PM", "CloseTime"=>"5:00 PM", "Day"=>"Sunday"}, {"OpenTime"=>"9:00 AM", "CloseTime"=>"6:00 PM", "Day"=>"Monday"}, {"OpenTime"=>"9:00 AM", "CloseTime"=>"6:00 PM", "Day"=>"Tuesday"}, {"OpenTime"=>"9:00 AM", "CloseTime"=>"7:00 PM", "Day"=>"Wednesday"}, {"OpenTime"=>"9:00 AM", "CloseTime"=>"6:00 PM", "Day"=>"Thursday"}, {"OpenTime"=>"8:00 AM", "CloseTime"=>"5:00 PM", "Day"=>"Friday"}, {"OpenTime"=>"10:00 AM", "CloseTime"=>"5:00 PM", "Day"=>"Saturday"}], "OverviewText"=>"<p>\n\tThe best of urban design has arrived in Odenton, Maryland. Welcome to Flats170 at Academy Yard, where you’ll be greeted with richly appointed interiors, first-class amenities, and eco-friendly touches that will make you feel right at home.</p><p>\n\tOur central location in Anne Arundel County means you are never far from work or play. We are next door to Fort Meade and the NSA, close to numerous defense and tech companies, and within 30 minutes of Annapolis, Baltimore, and Washington, DC. The MARC train station is less than one mile down the road, and BWI is just 10 minutes away.</p>", "OverviewTextStripped"=>"The best of urban design has arrived in Odenton, Maryland. Welcome to Flats170 at Academy Yard, where you’ll be greeted with richly appointed interiors, first-class amenities, and eco-friendly touches that will make you feel right at home. Our central location in Anne Arundel County means you are never far from work or play. We are next door to Fort Meade and the NSA, close to numerous defense and tech companies, and within 30 minutes of Annapolis, Baltimore, and Washington, DC. The MARC train station is less than one mile down the road, and BWI is just 10 minutes away.", "OverviewBullet1"=>"Brand new apartments with unparalleled amenities - Move in now! ", "OverviewBullet2"=>"Contemporary apartment finishes including granite counters and stainless steel appliances", "OverviewBullet3"=>"Convenient location to Route 170 and 32 & less than 30-minutes to Washington DC and Baltimore", "NeighborhoodText"=>"<h2>\n\tPaint the Town</h2><ul>\n\t<li>\n\t\t<strong>Restaurants: </strong>Starbuck’s, Houlihan’s Restaurant & Bar, Rinconcito Mexicano, Four Seasons Grill, Five Guys, Express Pit Beef, Hunan Rose, Three Brothers, Chipotle, Bonefish Grill, Coal Fire Grill, Fuji Japanese Steakhouse, Dairy Queen, Qdoba Mexican Grill, Panera Bread, Genghis Grill, Elevation Burger, Red Robin, Joe's Crab Shack, Olive Garden, Prime Rib, The Cheesecake Factory, Crab Galley</li>\n\t<li>\n\t\t<strong>Shopping:</strong> Wegmans, Giant, Food Lion, Weis, Safeway, Target, Bed Bath & Beyond, ULTA Beauty, Arundel Mills, Columbia Mall, Odenton Town Center</li>\n\t<li>\n\t\t<strong>Parks & Recreation:</strong> Odenton Recreation Park, Quail Run Dog Park, Meade Village Park</li>\n\t<li>\n\t\t<strong>Theaters/Entertainment:</strong> Regal Cinemas, Cinemax, Maryland LIVE Casino</li>\n\t<li>\n\t\t<strong>Salons/Spas</strong>: Robert Andrew Salon & Spa, Massage Envy, Bubbles, Eccentrics Spa</li>\n\t<li>\n\t\t<strong>Banks:</strong> M&T, BB&T, Bank of America, PNC Bank, Suntrust, First National Bank, The Columbia Bank</li>\n</ul><h2>\n\tGetting Around</h2><ul>\n\t<li>\n\t\t<strong>Metro</strong>: New Carrollton</li>\n\t<li>\n\t\t<strong>Train</strong>: Odenton Marc Train Station</li>\n\t<li>\n\t\t<strong>Airports:</strong> Baltimore Washington International</li>\n\t<li>\n\t\t<strong>Major Highways/Roads:</strong> Crain Hwy/Route 3, Route 32, Route 100, Interstate-95, Baltimore Washington Parkway</li>\n</ul><h2>\n\tEducate Yourself</h2><ul>\n\t<li>\n\t\t<strong>Elementary School</strong>: Odenton Elementary School</li>\n\t<li>\n\t\t<strong>Middle School:</strong> Arundel Middle School</li>\n\t<li>\n\t\t<strong>High School</strong>: Arundel High School</li>\n\t<li>\n\t\t<strong>Colleges/Universities:</strong> University of Maryland, John Hopkins, University of Maryland Baltimore County</li>\n</ul>", "DirectionsURL"=>"http://maps.google.com/maps?daddr=8313%20Telegraph%20Rd,%20Odenton,%20MD", "ListingImageURL"=>"http://bozzuto.com/system/apartment_communities/291/square.jpg", "VideoURL"=>nil, "FacebookURL"=>"https://www.facebook.com/flats170academyyard", "TwitterHandle"=>"Flats170", "PinterestURL"=>nil}, "Feature"=>[{"Title"=>"Flats170 at Academy Yard", "Description"=>"<p>\n\t<span style=\"color:#808080;\"><span style=\"font-size:12px;\"><span style=\"font-family: arial, sans, sans-serif;\">Flats170 at Academy Yard promise luxury, eco-friendly apartments bursting with amenities. These premium apartments include private balconies, nine-foot ceilings, granite countertops, a swimming pool, fitness center complete with yoga, kickboxing and CrossFit studios, a cinema-quality movie theater in addition to a large central courtyard with grilling stations and a business center with a cyber cafï¿½. And then there’s the location. The Odenton, Maryland, property is in the heart of Anne Arundel County. The MARC train station is less than a mile away, the New Carrollton metro is nearby and the community is right by major highways in the region—making it ideal for commuters. Fort Meade is a quick drive away and Flats170 also offers special programs for military employees. </span></span></span>The community is also centrally located in a great school district.<span style=\"color:#808080;\"><span style=\"font-size:12px;\"><span style=\"font-family: arial, sans, sans-serif;\">. Discover more amenities available by reading below.</span></span></span></p>"}, {"Title"=>"Amenities", "Description"=>"<ul>\n\t<li>\n\t\tSouth Beach-inspired pool & sundeck overlook clubroom lounge and bar</li>\n\t<li>\n\t\tResort-Style Lobby and Lounge</li>\n\t<li>\n\t\tClubroom with Bar & Billiards</li>\n\t<li>\n\t\tFitness center with yoga room</li>\n\t<li>\n\t\tKickboxing and cross fit studio</li>\n\t<li>\n\t\tBusiness center & cyber cafe including e-lounge and conference room</li>\n\t<li>\n\t\tCinema-quality movie theater </li>\n\t<li>\n\t\tLarge central courtyard with grilling stations </li>\n\t<li>\n\t\tParks, exercise trail, dog park & wooded stream</li>\n\t<li>\n\t\tPrivate storage available </li>\n\t<li>\n\t\tBike storage areas and self-serve bike repair shop</li>\n\t<li>\n\t\tMARC train just under a mile away</li>\n</ul><h2>\n\tFeatures</h2><ul>\n\t<li>\n\t\tSpacious open floor plans - 25 different layouts</li>\n\t<li>\n\t\t9-foot ceilings in all homes</li>\n\t<li>\n\t\t2-story loft (up to 18-foot ceilings) apartments available</li>\n\t<li>\n\t\tLuxurious granite countertops </li>\n\t<li>\n\t\tStainless steel appliances with gas range</li>\n\t<li>\n\t\tBrushed nickel hardware throughout with chrome in baths</li>\n\t<li>\n\t\tWide rail, shaker-style maple cabinets with espresso finish </li>\n\t<li>\n\t\tLinen Kola tile in kitchen, foyer and baths</li>\n\t<li>\n\t\tModern fixtures in kitchen and bath, including pull-out kitchen faucet</li>\n\t<li>\n\t\tModern tile tub surrounds and curved shower bars</li>\n\t<li>\n\t\tExpansive windows </li>\n\t<li>\n\t\tUndermount sink</li>\n\t<li>\n\t\tCustom concrete and stainless steel shelving at entry</li>\n\t<li>\n\t\tEnergy-efficient designer lighting </li>\n\t<li>\n\t\tPrivate balconies</li>\n\t<li>\n\t\tPrivate garages available </li>\n\t<li>\n\t\tPet Friendly </li>\n</ul>"}, {"Title"=>"Green Features ", "Description"=>"<h2>\n\tEnergy and Water Efficiency</h2><ul>\n\t<li>\n\t\tHighly-efficient HVAC systems to cut down utility usage (and bills!) by more than 15%</li>\n\t<li>\n\t\tHigh-efficiency dual-flush toilets, showerheads and faucets to reduce approximately 40% of water consumption</li>\n\t<li>\n\t\tENERGY STARï¿½ Certified appliances</li>\n\t<li>\n\t\tLow-energy lighting</li>\n\t<li>\n\t\tEach residence is well insulated and sealed for thermal comfort</li>\n</ul><h2>\n\tIndoor Environmental Quality</h2><ul>\n\t<li>\n\t\t100% Smoke-free community</li>\n\t<li>\n\t\tLow VOC paints, adhesives, and carpet for a healthy living environment</li>\n\t<li>\n\t\tApartment home doors are air-sealed to outside and neighboring homes</li>\n\t<li>\n\t\tAdditional insulation and caulking to better seal building for energy efficiency and sound purposes</li>\n\t<li>\n\t\tNatural ventilation from outside bringing controlled fresh into your apartment home</li>\n</ul><h2>\n\tSustainable Site</h2><ul>\n\t<li>\n\t\tThe project is built with over 75% of recycled and regionally sourced materials</li>\n\t<li>\n\t\tOver 90% of construction waste has been diverted from landfills</li>\n\t<li>\n\t\tEasy access to MARC station and CMRT K route bus</li>\n\t<li>\n\t\tEcologically balanced landscaping with high-efficiency irrigation</li>\n\t<li>\n\t\tRadon-resistant construction elements</li>\n</ul><h2>\n\tGreen Community features</h2><ul>\n\t<li>\n\t\tDesigned to achieve LEEDï¿½ Silver certification </li>\n\t<li>\n\t\tRecycling program</li>\n\t<li>\n\t\tBike storage to promote eco-friendly transportation</li>\n\t<li>\n\t\tUse of green cleaning products</li>\n</ul><p>\n\t<span style=\"color:#808080;\"><span style=\"font-size:12px;\"><span style=\"font-family: arial, sans, sans-serif;\">The property’s central location means restaurants, offices and even outdoor trails are all at just steps outside your door. Flats 170 also offers its residents unmatched amenities including a dog park, contemporary design and cutting-edge appliances. If you’re searching for a luxurious and eco-friendly home to call your own, please contact Bozzuto today to start leasing. </span></span></span></p>"}], "FeaturedButton"=>[{"Name"=>"SmartRent"}, {"Name"=>"Military"}, {"Name"=>"Non Smoking"}, {"Name"=>"Pet Friendly"}, {"Name"=>"Green"}, {"Name"=>"Washer and Dryer"}, {"Name"=>"Brand New"}], "PhotoSet"=>nil, "Slideshow"=>{"SlideshowImageURL"=>["http://bozzuto.com/system/property_slides/2251/slide.jpg", "http://bozzuto.com/system/property_slides/2364/slide.jpg", "http://bozzuto.com/system/property_slides/3057/slide.jpeg", "http://bozzuto.com/system/property_slides/2365/slide.jpg", "http://bozzuto.com/system/property_slides/2366/slide.jpg", "http://bozzuto.com/system/property_slides/2250/slide.jpg", "http://bozzuto.com/system/property_slides/2362/slide.jpg", "http://bozzuto.com/system/property_slides/2363/slide.jpg", "http://bozzuto.com/system/property_slides/2185/slide.jpg"]}, "Floorplan"=>[{"Id"=>"10835", "Name"=>"AD6 Den", "FloorplanAvailabilityURL"=>"http://flats170.securecafe.com/onlineleasing/flats170-at-academy-yard/oleapplication.aspx?stepname=Apartments&myOlePropertyId=226816&floorPlans=1044852", "DisplayedUnitsAvailable"=>"0", "ImageURL"=>"https://cdn.rentcafe.com/dmslivecafe/3/226816/MD_Odenton_Flats170_p0233505_New_1BedAD61037sf_2_FloorPlan.jpg", "Bedrooms"=>"1", "Bathrooms"=>"1.0", "SquareFeet"=>{"Min"=>"1037", "Max"=>"1037"}, "MarketRent"=>{"Min"=>"0", "Max"=>"0"}, "EffectiveRent"=>{"Min"=>"0", "Max"=>"0"}}, {"Id"=>"10836", "Name"=>"A1", "FloorplanAvailabilityURL"=>"http://flats170.securecafe.com/onlineleasing/flats170-at-academy-yard/oleapplication.aspx?stepname=Apartments&myOlePropertyId=226816&floorPlans=104