iving here. Even your car will love living here. Rooftop amenities including an infinity pool, dog park, lounge and fire pits. And with rock-star amenities like these, what's not to love about City Market at O Street?</p>", "OverviewTextStripped"=>"City Market at O, located in NW, Washington, DC, is the new element of style. You'll love living here. Your dog will love living here. Even your car will love living here. Rooftop amenities including an infinity pool, dog park, lounge and fire pits. And with rock-star amenities like these, what's not to love about City Market at O Street?", "OverviewBullet1"=>"Brand new apartments in Shaw", "OverviewBullet2"=>"Spacious, open floor plans with outstanding finishes", "OverviewBullet3"=>"Walk to metro and on-site gourmet food market", "NeighborhoodText"=>"<p style=\"margin-bottom: 0in;\">\n\t<span style=\"font-size: 22px;\">Paint the Town </span></p><p style=\"margin-bottom: 0in;\">\n\tEnjoy the new element of style in Shaw with the chic comforts of home and the conveniences of DC at your doorstep. A unique urban vibe with sidewalk cafï¿½s, corner coffeehouses and modern lifestyle.</p><ul>\n\t<li>\n\t\t<strong>Restaurants: </strong>Ben's Chili Bowl, Oohhs & Aahhs, Busboys & Poets, Birch & Barley, Posto, Estadio, Logan Tavern, Pearl Dive Oyster Palace, Acadiana, Finn & Porter, Rogue 24, Zula Restaurant, Azi’s Cafï¿½, A&D Neighborhood Bar, Corduroy, Dickson Wine Bar, Nellie’s Sports Bar, Old Dominion Brewhouse, Rogue 24, Seasonal Pantry, SUNdeVICH, Table, The Brixton, The Passenger, Vinoteca DC</li>\n\t<li>\n\n\t\t\t<strong>Bars: </strong>1905 Restaurant & Lounge, Cause Bar, DC9 Nightclub, Presidents Sports Bar, Velvet Lounge\n\t</li>\n\t<li>\n\n\t\t\t<strong>Retail: </strong>AT&T, Seasonal Pantry, Bank of America, Boston Wine & Spirits, CVS, Giant Food\n\t</li>\n\t<li>\n\n\t\t\t<strong>Theaters: </strong>Howard Theatre, Landmark E Street Cinema, Regal Gallery Place\n\t</li>\n\t<li>\n\n\t\t\t<strong>Parks:</strong> Lincoln Park