"City"=>"Washington", "State"=>"DC", "PostalCode"=>"20001", "CountyName"=>"District of Columbia", "Lead2LeaseEmail"=>"7thFlats.Boz@lead2lease.com"}, "Phone"=>{"Type"=>"office", "PhoneNumber"=>"888.814.6267"}}, "Information"=>{"OfficeHour"=>[{"OpenTime"=>"9:00 AM", "CloseTime"=>"6:00 PM", "Day"=>"Monday"}, {"OpenTime"=>"9:00 AM", "CloseTime"=>"6:00 PM", "Day"=>"Tuesday"}, {"OpenTime"=>"9:00 AM", "CloseTime"=>"6:00 PM", "Day"=>"Wednesday"}, {"OpenTime"=>"9:00 AM", "CloseTime"=>"6:00 PM", "Day"=>"Thursday"}, {"OpenTime"=>"8:00 AM", "CloseTime"=>"5:00 PM", "Day"=>"Friday"}, {"OpenTime"=>"10:00 AM", "CloseTime"=>"5:00 PM", "Day"=>"Saturday"}], "OverviewText"=>"<p>\n\t\t\t\tBrand new apartments in the heart of Washington, DC's legendary Shaw neighborhood. Located right next to the Shaw-Howard U Metro and right above the neighborhood's new favorite places to eat, drink, and socialize at Progression Place.\n\n\t\t\t</p><p>\n\t\t\t\tThe highly anticipated 7th Flats Apartments at Progression Place blends the best of modern upscale living with the rich history of the Shaw community. From studios outfitted with the latest features to eclectic one bedroom homes with sweeping views of DC's skyline to historical two bedrooms with the building's original exposed brick walls, there's a place for everyone to call home at 7th Flats. </p>", "OverviewTextStripped"=>"Brand new apartments in the heart of Washington, DC's legendary Shaw neighborhood. Located right next to the Shaw-Howard U Metro and right above the neighborhood's new favorite places to eat, drink, and socialize at Progression Place. The highly anticipated 7th Flats Apartments at Progression Place blends the best of modern upscale living with the rich history of the Shaw community. From studios outfitted with the latest features to eclectic one bedroom homes with sweeping views of DC's skyline to historical two bedrooms with the building's original exposed brick walls, there's a place for everyone to call home at 7th Flats.", "OverviewBullet1"=>"Immediate access to the Shaw/Howard U Metro Station", "OverviewBullet2"=>"Impeccable apartment features and unparalleled amenities", "OverviewBullet3"=>"Vibrant lifestyle in the hottest area of DC", "NeighborhoodText"=>"<p style=\"margin-bottom: 0in\">\n\t<span style=\"font-size:22px;\">Paint the Town </span></p><p style=\"margin-bottom: 0in\">\n\tThe Shaw and LeDroit Park neighborhoods offer endless opportunities and all the conveniences of the city. Enjoy proximity to the Metro Red and Green lines, Union Station, Capitol Hill and vibrant nightlife options. Explore the urban vibe, sidewalk cafï¿½s, corner coffeehouses and the arts that surround you. </p><ul>\n\t<li>\n\n\t\t\t<strong>Onsite Retail and Dining</strong><strong>: </strong>Eat The Rich, [solidcore], Southern Efficiency, Mockingbird Hill, Right Proper Brewery, Sprint, Uprising Muffin Company, Fishnet Restaurant, Wanda's on 7th, Bank of America\n\t</li>\n\t<li>\n\n\t\t\t<strong>Restaurants: </strong>Bacio Pizzeria, Beau Thai Restaurant, Big Bear Cafï¿½, Rustik Tavern, Ben's Chili Bowl, Busboys & Poets, Birch & Barley, Posto, Estadio, Logan Tavern, Pearl Dive Oyster Palace, Acadiana, Finn & Porter, Rogue 24, Zula Restaurant\n\t</li>\n\t<li>\n\n\t\t\t<strong>Bars: </strong>1905 Restaurant & Lounge, Cause Bar, DC9 Nightclub, Presidents Sports Bar, Velvet Lounge\n\t</li>\n\t<li>\n\n\t\t\t<strong>Retail: </strong>AT&T, Seasonal Pantry, Bank of America, Boston Wine & Spirits, CVS, Giant Food\n\t</li>\n\t<li>\n\n\t\t\t<strong>Theaters: </strong>Howard Theatre, Landmark E Street Cinema, Regal Gallery Place\n\t</li>\n\t<li>\n\n\t\t\t<strong>Parks:</strong> Lincoln Park, Folger Park, Marion Park, Stanton Park, Toka Salon\n\t</li>\n\t<li>\n\n\t\t\t<strong>Sport Venues:</strong> Verizon Center, RFK Stadium, FedEx Field, Nationals Park\n\t</li>\n</ul><p style=\"margin-bottom: 0in\">\n\t<span style=\"font-size:22px;\">Getting Around</span></p><ul>\n\t<li>\n\n\t\t\t<strong>Metro:</strong> Walk to M