iewTextStripped"=>"The Palatine features beautifully designed apartments with upscale finishes and luxury amenities to make you feel at home. Ideally located in Arlington, VA, with close proximity to major DC landmarks and just a few blocks from the Courthouse Metro station, The Palatine offers easy access to high-end shopping, notable restaurants and entertainment. The wonderful balance of nearby office, retail and hotel options coupled with a successful blend of urban sophistication and neighborhood charm foster a thriving and energetic lifestyle in a highly sought after location to live, work and play.", "OverviewBullet1"=>"Located in the heart of Arlington, only 2 blocks from the Courthouse Metro", "OverviewBullet2"=>"Breathtaking Views of Arlington, Washington DC and the monument", "OverviewBullet3"=>"Amazing amenities including rooftop pool with sundeck, resident lounge and state of the art fitness center", "NeighborhoodText"=>"<p style=\"margin-bottom: 0in;\">\n\t<span style=\"font-size: 22px;\">Paint the Town</span></p><p style=\"margin-bottom: 0in;\">\n\tHere at The Palatine you are just steps from an array of shopping, dining and entertainment options. You’ll appreciate our convenient location with access to the Clarendon, Courthouse and Rosslyn Metro stations, as well as our close proximity to major employers in downtown Washington D.C., Georgetown, Arlington and Rosslyn. Catch a movie, dine at one of many nearby restaurants, or spend the afternoon shopping in the neighborhood at destinations such as Ballston Common Mall. At the end of the day, relax and unwind by enjoying one of the area’s many nightlife venues. Make The Palatine your home, and find yourself at the center of it all.</p><ul>\n\t<li>\n\n\t\t\t<strong>Restaurants/Bars:</strong> Bayou Bakery, Clarendon Ballroom, Ireland’s Four Courts, Liberty Tavern, Ragtime, Ray’s the Steaks, Spider Kelly’s, Whitlows on Wilson, Cheesecake Factory, La Tasca, Tandoori Nights, Mister Day's Bar & Grill, Baja Fresh, Hard Times Cafï¿½\n\t</li>\n\t<li>\n\n\t\t\t<strong>Shopping:</strong>Ballston Common Mall, CVS, Market Common Clarendon, Safeway, Whole Foods, Georgetown Valet, Pottery Barn, Williams-Sonoma, Apple Store, Free People, Chico's, Origins, Ann Taylor Loft, Barnes & Noble, Eastern Mountain Sports, Jos. A. Bank, Crate & Barrel, Container Store, Orvis, The Papery, T-Mobile, Lulelemon Athletica, Red Mango, MyEyeDr., Ethan Allen, Palm Beach Tan, South Moon Under, Gold's Gym, Washington Sports Club, Ann Taylor\n\t</li>\n\t<li>\n\n\t\t\t<strong>Entertainment:</strong> AMC Courthouse Theater, Arlington National Cemetery, Dog Park, Freedom Park (Marine Corp Memorial), Kennedy Center\n\t</li>\n\t<li>\n\n\t\t\t<strong>Sport Venues:</strong> Verizon Center, Nationals Park<br>\n\t\t\t<br>\n\n\t</li>\n</ul><p style=\"margin-bottom: 0in;\">\n\t<span style=\"font-size: 22px;\">Getting Around</span></p><ul>\n\t<li>\n\t\t<strong>Metro:</strong> Courthouse Metro (Orange Line) two blocks from building</li>\n\t<li>\n\t\t<strong>Airport:</strong> Reagan National</li>\n\t<li>\n\t\t<strong>Train:</strong> Union Station</li>\n\t<li>\n\t\t<strong>Highways:</strong> Quick access to I-66, I-395, I-495</li>\n</ul><p style=\"margin-bottom: 0in;\">\n\t<span style=\"font-size: 22px;\">Educate Yourself</span></p><ul>\n\t<li>\n\t\t<strong>Elementary School: </strong>Key Elementary School, Arlington Science Focus</li>\n\t<li>\n\t\t<strong>Middle School:</strong> Jefferson Middle School</li>\n\t<li>\n\t\t<strong>High School:</strong> Washington Lee High School</li>\n\t<li>\n\t\t<strong>Colleges/Universities:</strong> Marymount University</li>\n</ul>", "DirectionsURL"=>"http://maps.google.com/maps?daddr=1301%20North%20Troy%20Street,%20Arlington,%20VA", "ListingImageURL"=>"http://bozzuto.com/system/apartment_communities/392/square.jpg", "VideoURL"=>nil, "FacebookURL"=>"http://www.facebook.com/ThePalatineVirginia", "TwitterHandle"=>"ThePalatine", "PinterestURL"=>nil}, "Feature"=>[{"Title"=>"The Palatine Apartments", "Description"=>"<p>\n\t<span style=\"color:#808080;\"><span style=\"font-size:12px;\"><span style=\"font-family: arial, sans, sans-serif;\">The Palatine Apartments offer residents a high-end apartment community in one of Arlington, Virginia’s best neighborhood. This property is just a few blocks from the Courthouse Metro Station—giving renters access to top sites like the Verizon Center and other key Washington, D.C. sites—and right by popular spots like the Ballston Common Mall and Marymount University. Its proximity to I-66 makes it an ideal place for commuters to call home and access Virginia, Maryland and the District. Each spacious home at the Palatine features oversized soaking tubs, Energy Star stainless steel appliances and large walk-in closets. The community includes a rooftop pool with sundeck, fitness center and breathtaking views of Arlington, Washington, D.C. and the National Monument. Read on for the complete list of modern amenities and features that await you at The Palatine Apartments.</span></span></span></p>"}, {"Title"=>"Features", "Description"=>"<ul>\n\t<li>\n\t\tEnergy Star stainless steel appliances</li>\n\t<li>\n\t\tFloor-to-ceiling windows available</li>\n\t<li>\n\t\tLow-E glass windows</li>\n\t<li>\n\t\tBreathtaking views of Arlington, Washington DC and the monuments</li>\n\t<li>\n\t\tOversized soaking tubs</li>\n\t<li>\n\t\tBalcony/Patio available</li>\n\t<li>\n\t\tGranite countertops</li>\n\t<li>\n\t\tLarge walk-in closets</li>\n</ul><h2>\n\tAmenities</h2><ul>\n\t<li>\n\t\tResident Lounge great for entertaining or just relaxing</li>\n\t<li>\n\t\tFitness Club with cardio equipment and free weights</li>\n\t<li>\n\t\tGarage Parking</li>\n\t<li>\n\t\tEasy access to the Courthouse Metro</li>\n\t<li>\n\t\tPet friendly</li>\n\t<li>\n\t\tControlled access building</li>\n\t<li>\n\t\tPool and sundeck</li>\n\t<li>\n\t\tPrivate, landscaped courtyard</li>\n</ul><p>\n\t<span style=\"font-size:12px;\"><span style=\"color:#808080;\"><span style=\"font-family: arial, sans, sans-serif;\">Renters searching for a luxurious home in a great location in Arlington, Virginia should consider calling The Palatine Apartments home. Residents here are just a few blocks from the Courthouse Metro Station and near I-66, making it an ideal spot for commuters. The top amenities at Palatine include a rooftop pool, fitness center and stunning views of Arlington and Washington, D.C. Contact Bozzuto today to discuss leasing a home at this stellar community. </span></span></span></p>"}], "FeaturedButton"=>[{"Name"=>"Pet Friendly"}, {"Name"=>"Fitness Center"}, {"Name"=>"Washer and Dryer"}], "PhotoSet"=>nil, "Slideshow"=>{"SlideshowImageURL"=>["http://bozzuto.com/system/property_slides/2221/slide.jpg", "http://bozzuto.com/system/property_slides/2222/slide.jpg", "http://bozzuto.com/system/property_slides/2224/slide.jpg", "http://bozzuto.com/system/property_slides/3414/slide.jpg", "http://bozzuto.com/system/property_slides/3415/slide.jpg", "http://bozzuto.com/system/property_slides/3416/slide.jpg", "http://bozzuto.com/system/property_slides/3417/slide.jpg"]}, "NearbyCommunity"=>[{"Id"=>"276", "Name"=>"Avery Row"}, {"Id"=>"717", "Name"=>"Bennett Park"}, {"Id"=>"753", "Name"=>"Park Adams"}, {"Id"=>"244", "Name"=>"vPoint"}, {"Id"=>"715", "Name"=>"The Maxwell"}, {"Id"=>"62", "Name"=>"Halstead Arlington"}], "Floorplan"=>[{"Id"=>"15613", "Name"=>"Saronno", "FloorplanAvailabilityURL"=>"http://palatineapts.securecafe.com/onlineleasing/the-palatine-apartments/oleapplication.aspx?stepname=Apartments&myOlePropertyId=207921&floorPlans=1028047", "DisplayedUnitsAvailable"=>"0", "ImageURL"=>"https://cdn.rentcafe.com/dmslivecafe/3/207921/VA_Arlington_ThePalatine_p0214625_Saronno_2_FloorPlan.jpg", "Bedrooms"=>"1", "Bathrooms"=>"1.0", "SquareFeet"=>{"Min"=>"758", "Max"=>"758"}, "MarketRent"=>{"Min"=>"0", "Max"=>"0"}, "EffectiveRent"=>{"Min"=>"0", "Max"=>"0"}}, {"Id"=>"15614", "Name"=>"Barbaresco", "FloorplanAvailabilityURL"=>"http://palatineap